  if (available_part) {
		string Description = "";
		bool result = UDMethods.GetPartDescription(Context.CompanyID,Inputs.var_company.Value, out Description);
		if(result)		
			Inputs.var_desc1.Value = Description;

	  string ium = "";
		result = UDMethods.GetPartIUM(Context.CompanyID,Inputs.var_company.Value, out ium);
		if(result)
			Inputs.var_uom1.Value = ium;

		string typecode = "";
		result = UDMethods.GetPartTypeCode(Context.CompanyID,Inputs.var_company.Value, out typecode);
		if (result)
			interimtype = typecode;
  }

  bool NonStock = false;
  bool available_partplant = UDMethods.GetPartPlantNonStock(Context.CompanyID,Inputs.var_company.Value, out NonStock);
  if (available_partplant) {
		isnonstock = NonStock;

  }


  /* Determines Part Type */
if ((interimtype == "P") && ( isnonstock == false)) {Inputs.var_type1.Value = "P-STK";}
if ((interimtype == "P") && ( isnonstock == true)) {Inputs.var_type1.Value = "P-BUY";}
if ((interimtype == "M") && ( isnonstock == false)) {Inputs.var_type1.Value = "M-STK";}
if ((interimtype == "M") && ( isnonstock == true)) {Inputs.var_type1.Value = "M-MFG";}
if ((interimtype == "K") && ( isnonstock == true)) {Inputs.var_type1.Value = "M-MFG";}

