if (Inputs.var_partqty1.Value > 0) {

  /* Retrieve Sales Price from Part record first */
  decimal list1pricepartrecord = 0m;

 bool available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_company.Value);
  if (available_part) {

		string pricepercode = "";
    decimal partunitprice = 0m;

		Inputs.var_part1cost.ToolTip = pricepercode;

		bool result = UDMethods.GetPartUnitPrice(Context.CompanyID, Inputs.var_company.Value, out partunitprice, out pricepercode);

		//FieldToolTip('Inputs.var_part1cost.Value',part.pricepercode);
		Inputs.var_part1cost.ToolTip = pricepercode;


		if (pricepercode == "E") { list1pricepartrecord = partunitprice * Inputs.var_partqty1.Value; }

		if (pricepercode == "C") { list1pricepartrecord = (partunitprice / 100) * Inputs.var_partqty1.Value; }

		if (pricepercode == "M") { list1pricepartrecord = (partunitprice / 1000) * Inputs.var_partqty1.Value; }

		Inputs.var_nocost1.Value = false;
  }


if (list1pricepartrecord > 0) {Inputs.var_part1cost.Value = list1pricepartrecord;}

  if (list1pricepartrecord == 0) {
    /* Check CSV file for referenced value */
    string part1listpriceentry = "";
    part1listpriceentry = "PENDING";
    part1listpriceentry = PCLookUp.DataLookup("ENGJOB_ACCESSCONTROL_Components", "listprice_entry", Inputs.cmb_part1.Value);
    if (part1listpriceentry != "") {
      Inputs.var_part1cost.Value = UDMethods.ConvertToDecimal(part1listpriceentry) * Inputs.var_partqty1.Value;
      Inputs.var_nocost1.Value = false;
    }

    if (part1listpriceentry =="") {
      Inputs.var_nocost1.Value = true;
    }
  }
}









