 /* CompWeight1 */
 if (Inputs.var_part1.Value != "")
 {
     available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part1.Value);
 }
 if (available_part)
 {
     UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_company.Value, out partWeight);
     CompWeight1 = partWeight * ivar_partqty1;
 }


