  if (Inputs.var_part2.Value != "")
  {
      available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_part2.Value);
  }
  if (available_part)
  {
      UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_company.Value, out partWeight);
      CompWeight2 = partWeight * ivar_partqty2;
  }


