/* Retrieve the base currency set at Company level */

 string CustName = "";
 string CustCountry = "";
 string currencyCode = "";

 int id = System.Convert.ToInt32( Inputs.var_company.Value );
 bool available_Customer = UDMethods.GetCustomer(Context.CompanyID, id, out CustName, out CustCountry, out currencyCode);

if (available_Customer) {
  Inputs.var_basecurrency.Value = currencyCode;

  /* Retrieves customer details using customer ID */
  Inputs.var_customername.Value = CustName;


}

/* Retrieve based on the configurator mode context */
string currencymode = "";
currencymode = Context.Entity;


if ((currencymode == "JOB") || ( currencymode == "TEST")) {

  //available_Customer = UDMethods.GetCustomerFunction(Context.CompanyID,Inputs.var_custid.Value, out Customeritem);
  available_Customer = false; // UDMethods.GetCustomer(Context.CompanyID,Inputs.var_custid.Value, out CustName, out CustCountry, out currencyCode);

  if (available_Customer) {
    Inputs.var_custcurrency.Value = currencyCode;
    Inputs.var_custcurrency1.Value = currencyCode;
  }
}





